var AuthenticationViewModel=function(){var a=this;a.username=null;a.password=null;a.rememberMe=null;a.error=null;a.subminEvent=ko.observable();a.Login=function(b){a.username=$(b.username).val();a.password=$(b.password).val();a.rememberMe=$(b.remember_me).is(":checked")?"on":"off";EventDispatcher.DispatchEvent(a.subminEvent(),a)};a.ClickZPayment=function(){};a.ForgotPassword=function(){window.location.href="https://"+window.location.hostname+"/resetting/request"};a.CloseForm=function(){var b=Parameters.cache.lastPage;if(b.route=="login"||!b.route){Routing.SetHash("default","Домашняя",{})}else{Routing.SetHash(b.route,b.title,b.data)}}};